import React from "react";
import * as Renderer from "./renderer";
import componentStyle from "./index.module.css";

export default class SecondPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  componentDidMount() {
    console.log(this.threeJsViewer);
    let renderer = Renderer.initRenderer(this.threeJsViewer);
    // Renderer.initGuiControl(this.threeJsGuiController);
  }
  render() {
    return (
      <div className={componentStyle.container}>
        <div className={componentStyle["params-input"]}></div>
        <div>
          <div className={componentStyle["echart-viewer"]}></div>
          <div className={componentStyle["threeJS"]}>
            <canvas
              ref={(ref) => {
                this.threeJsViewer = ref;
              }}
              className={componentStyle["threeJS-viewer"]}
            ></canvas>
            <div
              ref={(ref) => {
                this.threeJsGuiController = ref;
              }}
              className={componentStyle["threeJS-guiController"]}
            ></div>
          </div>
        </div>
      </div>
    );
  }
}
